export const BASE_URL = 'http://104.131.160.75:3000';

export const register = (password, email) => {
  return fetch(`${BASE_URL}/signup`, {
    method: 'POST',
    headers: {
      Accept: 'application/json',
      'Content-Type': 'application/json',
    },
    body: JSON.stringify({ email, password }),
  })
    .then((res) => {
      console.log(res);

      if (res.ok) {
        return res.json();
      }
    })
    .then((result) => {
      console.log(result);
    });
};
